import React, { useEffect } from 'react'

function Movielist2() {
    React.useEffect(() => {
        fetch('https://imdb-api.com/API/Top250Movies/k_us0ny6v5')
          .then(results => results.json())
          .then(data => {
            console.log(data);});
      }, []);
  return (
    
    <div></div>
  )
}

export default Movielist2
